import axios from 'axios';
import { useEffect, useState } from 'react';
import './testB.css';

export default function TestB() {
    const URL = 'http://localhost:8080';
    const URL2 = 'https://random.dog/woof.json';

    const [durl, setdurl] = useState('');

    function getData() {
        // fetch(URL).then(res => res.text()).then(data => alert(data));
        axios.get(URL2).then(res => {
            setdurl(res.data.url);

            console.log(durl);
        });
    }

    return (
        <>
        <div className='testBdiv'>
            <h3>Click the Button to get the data from the backend</h3>
            <button className="btn btn-primary" onClick={getData}>Get Data</button>
        </div>
        </>
    );
}
